import './game.css'

import { Title, Button } from '../../components';
import '../../Styles.css'


function Game() {
  const lines = 5

  function createLines(lines){
    for(var i = 0; i < lines; i++){
      var n = <div></div>
      return n
    }
  }

  return (
    <div className="App">
      <div className='start'>
        <Title/>
        <p>Player 1</p>
        <div className="line line1">
          <button className='buttonGame'>|</button>
        </div>
        <div className="line line2">
          <button className='buttonGame'>|</button>
          <button className='buttonGame'>|</button>
        </div>
        <Button>Passar</Button>

        {createLines(lines)}

      </div>
    </div>
    );
  }
  
  export default Game;
